import React, { useState } from 'react';
import { Navbar, Nav, Container, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom'; // Import useNavigate
import GreenTrendz from '../assets/img/logo_1.png';
import HomePage from './HomePage';

const styles = {
    // ... (existing styles)
    backButton: {
        backgroundColor: '#28a745',
        color: '#fff',
        fontSize: '14px',
        borderRadius: '5px',
        border: 'none',
        padding: '5px 10px',
        cursor: 'pointer',
        marginRight: '10px',
    },
};

const LoginPage = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate(); // Initialize navigate

    const handleLogin = (e) => {
        e.preventDefault();
        console.log('Login clicked with email:', email, 'and password:', password);
    };

    return (
        <div>
            <header>
                <Navbar bg="light" expand="lg" className="shadow-sm py-3 custom-navbar">
                    <Container>
                        <Navbar.Brand href="/" className="d-flex align-items-center">
                            <img
                                src={GreenTrendz}
                                alt="Logo"
                                width="50"
                                height="50"
                                className="d-inline-block align-top me-2"
                            />
                            <span className="brand-text">GreenTrendz</span>
                        </Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="ms-auto d-flex align-items-center">
                                {/* Back button */}
                                <Button
                                    style={styles.backButton}
                                    onClick={() => navigate('/')}
                                >
                                    Back
                                </Button>
                                <Nav.Link href="/" className="nav-link-enhanced">
                                    Home
                                </Nav.Link>
                                <Nav.Link href="#services" className="nav-link-enhanced">
                                    Services
                                </Nav.Link>
                                <Nav.Link href="#about" className="nav-link-enhanced">
                                    About Us
                                </Nav.Link>
                                <Nav.Link href="#contact" className="nav-link-enhanced">
                                    Contact
                                </Nav.Link>
                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
            </header>

            <div style={styles.container}>
                <h1 style={styles.title}>Login</h1>
                <p style={styles.introText}>
                    Welcome back! Please enter your login details below to access your account.
                </p>
                <form style={styles.form} onSubmit={handleLogin}>
                    <div style={styles.inputGroup}>
                        <label htmlFor="email" style={styles.label}>
                            Email
                        </label>
                        <input
                            type="email"
                            id="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            style={styles.input}
                            required
                        />
                    </div>
                    <div style={styles.inputGroup}>
                        <label htmlFor="password" style={styles.label}>
                            Password
                        </label>
                        <input
                            type="password"
                            id="password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            style={styles.input}
                            required
                        />
                    </div>
                    <button type="submit" style={styles.button}>
                        Login
                    </button>
                </form>
                <p style={styles.newUserText}>
                    New user? <a href="/SignUp" style={styles.link}>Create an account</a>
                </p>
            </div>
        </div>
    );
};

export default LoginPage;
